import React from 'react';


const User = () => {
    return (
        <div>
            <h1>Choose to view User</h1>
            <a href="/userprofile"><button className="btn btn-lg btn-info">Profile</button></a>
            <a href="/userapplications"><button className="btn btn-lg btn-success">Applications</button></a>
        </div>
    )
}

export default User;
